import React from 'react'
import { Card } from './Card'
import removeTour from ''
const Tours = ({tours}) => {
  return (
    <div>
      <div>
         <h2>Plan with Dip</h2>
      </div>

      <div>
        {
           tours.map( (tour) =>{
            return <Card {...tour} removeTour = {removeTour}></Card>
           })
        }
      </div>
    </div>
  )
}

export default Tours
